import React from 'react';
import './appcss.css';
import { Grid } from 'gymnast';
import { connect } from 'react-redux';
import Dataprint from './../_components/dataPrint';
import LessonDatas from '../_data/lessonData';
import ModalGraph from '../_components/modalgraph';
import {allActions} from '../_actions';
import ModalSchool from '../_components/modalSchool';
import ModalLesson from '../_components/modalLesson';
import LessonChooseGraph from '../_components/LessonChooseGraph';


class homeScreen extends React.Component {
    constructor() {
        super();
        this.handleClick = this.handleClick.bind(this);
        this.state = {
            data: {},
            colors: 'white',
            colors1: 'green'

        };
     }



     handleClick() {
     }
     render() {
        return (
         <div class="container-fluid" style={{background:"withe"}}>
            <div class="row">
               <div class="col-sm-3">One of three columns</div>
               <div class="col-sm-3">One of three columns</div>
               <div class="col-sm-3">One of three columns</div>
               <div class="col-sm-3">One of three columns</div>
            </div>
            <div class="row">
               <div class="col-sm-3"><h3 class="text-primary">Таны Судалсан хичээл</h3></div>
               <div class="col-sm-3"><h3 class="text-primary">Үзэх боломжгүй хичээл</h3></div>
               <div class="col-sm-3"><h3 class="text-primary">Үзэх боломжтой хичээл</h3></div>
               <div class="col-sm-3"><h3 class="text-primary">Залгамж болон Өмнөх хичээл</h3></div>
            </div>

            <div class="row">
               <div class="col-sm-3">
                  <div class="col-sm-12">1 Күрсийн үзвэл зохих хичээл</div>
                  <div class="col-sm-12">{this.props.allLessonData[0].data1.map((person, i) => <Dataprint data={person}></Dataprint>)}</div>
               </div>
               <div class="col-sm-3">
                  <div class="col-sm-12">2 Күрсийн үзвэл зохих хичээл</div>
                  <div class="col-sm-12">{this.props.allLessonData[1].data2.map((person, i) => <Dataprint data={person}></Dataprint>)}</div>
               </div>
               <div class="col-sm-3">
                  <div class="col-sm-12">3 Күрсийн үзвэл зохих хичээл</div>
                  <div class="col-sm-12">{this.props.allLessonData[2].data3.map((person, i) => <Dataprint data={person}></Dataprint>)}</div>
               </div>
               <div class="col-sm-3">
                  <div class="col-sm-12">4 Күрсийн үзвэл зохих хичээл</div>
                  <div class="col-sm-12">{this.props.allLessonData[3].data4.map((person, i) => <Dataprint data={person}></Dataprint>)}</div>
               </div>
            </div>
            <div class="row">
               <div class="col-sm-12">
                  <div class="col-sm-12">5 Күрсийн үзвэл зохих хичээл</div>
                  <div class="col-sm-12">{this.props.allLessonData[4].data5.map((person, i) => <Dataprint data={person}></Dataprint>)}</div>
               </div>
            </div>



         </div>

        );
     }
}

export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(homeScreen);
